import { render } from '@testing-library/react';
import React from 'react';

function Search(){
    return(
        <div className="container">
            <div className="container text-center text-box">
                <h1>Search Tweets by User or Content</h1>
            </div>
            <form>
                <div className="input-group">
                    <input type="text" className="form-control" placeholder="Search User or Content"></input>
                    <button className="btn btn">Search User</button>
                    <button className="btn">Search Content</button>
                </div>
            </form>
        </div>
    )
}



export default Search;
